use std::ops::Neg;
use hsl::HSL;
use iter_num_tools::lin_space;
use num_complex::Complex;
use num_complex::Complex64;
use num_complex::ComplexFloat;
use plotly::Image;
use plotly::color::NamedColor;
use plotly::image::ColorModel;
use plotly::{color::Rgb, common::Mode, Layout, Plot, Scatter};

use crate::*;

pub trait DrawBary {
     fn draw(&self);
}

pub trait DrawWithPz {
     fn draw_with_pz(&self);
}

impl DrawWithPz for Barycentric<f64>{
    fn draw_with_pz(&self) {

    let min = self.nodes.iter().cloned().reduce(f64::min).unwrap();
    let max = self.nodes.iter().cloned().reduce(f64::max).unwrap();

    let pz = self.przr();

    let pol = pz.poles;
    let px: Vec<f64> = pol.iter().map(|f|f.re()).collect();
    let py: Vec<f64> = pol.iter().map(|f|f.im()).collect();

    let zer = pz.zeros;
    let zx: Vec<f64> = zer.iter().map(|f|f.re()).collect();
    let zy: Vec<f64> = zer.iter().map(|f|f.im()).collect();

    let x: Vec<f64> = lin_space(min..=max, 3000).collect();

    let mut val: Vec<f64> = Vec::new();


    for i in &x {
    val.push(self.evaluate(*i));
    }

    let crv = Scatter::new(x.clone(), val)
        .mode(Mode::Lines).name("Approximation");

    let p = Scatter::new(px, py)
        .mode(Mode::Markers).fill_color(Rgb::new(255, 0, 0)).name("Poles");

    let z = Scatter::new(zx, zy)
        .mode(Mode::Markers).fill_color(Rgb::new(0, 0, 255)).name("Zeros");


    let mut plot = Plot::new();
    let layout = Layout::new().height(1000).width(1000).auto_size(false);
    plot.set_layout(layout);

    plot.add_trace(crv);
    plot.add_trace(p);
    plot.add_trace(z);

    plot.show();
    }
}

impl DrawWithPz for Barycentric<Complex<f64>>
{
     fn draw_with_pz(&self) {
        
        let pz = self.przr();

        let pol = pz.poles;
        let px: Vec<f64> = pol.iter().map(|f: &Complex<f64>|f.re()).collect();
        let py: Vec<f64> = pol.iter().map(|f: &Complex<f64>|f.im()).collect();

        let zer = pz.zeros;
        let zx: Vec<f64> = zer.iter().map(|f: &Complex<f64>|f.re()).collect();
        let zy: Vec<f64> = zer.iter().map(|f: &Complex<f64>|f.im()).collect();

        let nmax = self.nodes.iter().map(|a| a.re()).reduce(f64::max).unwrap();
        let nmin = self.nodes.iter().map(|a| a.re()).reduce(f64::min).unwrap();

        let xx: Vec<f64> = lin_space(nmin..=nmax, 1000).collect();
        let mut ptsmain: Vec<Complex64> = Vec::new();

        for i in &xx {
        ptsmain.push(self.evaluate((*i).into()));
        }

        let size = 1000;
        let img_size = 1000;

        let img_max = self.values.iter().map(|a| a.abs()).reduce(f64::max).unwrap();
        let img_min = img_max.neg();
        let img_max = img_max;

        let xi: Vec<f64> = lin_space(img_min..=img_max, img_size).collect();
        let mut pixels = vec![vec![Rgb::new(0, 0, 0); img_size]; img_size];
        pixels.iter_mut().zip(xi.iter()).for_each(|(i, j)| {
            i.iter_mut().zip(xi.iter()).for_each(|(k, l)| {
                *k = phase_coloring_scheme(std::f64::consts::E)(self.evaluate(Complex64::new(*l, *j)));
            });
        });

        let pos = img_max.neg();
        let scale = (img_max / img_size as f64) * 2.0;
        let comp_img = Image::new(pixels).color_model(ColorModel::RGB).dy(scale).y0(pos).dx(scale).x0(pos);


        let x: Vec<f64> = ptsmain.iter().map(|f|f.re()).collect();
        let y: Vec<f64> = ptsmain.iter().map(|f|f.im()).collect();

        let crv = Scatter::new(x, y)
            .mode(Mode::Lines).name("Approximation").fill_color(NamedColor::Red);

        let p = Scatter::new(px, py)
            .mode(Mode::Markers).fill_color(NamedColor::Black).name("Poles");

        let z = Scatter::new(zx, zy)
            .mode(Mode::Markers).fill_color(NamedColor::White).name("Zeros");

        let uccrv = Scatter::new(UNIT_CIRCLE_X.to_vec(), UNIT_CIRCLE_Y.to_vec())
            .mode(Mode::Lines).name("Unit Circle");

        let mut plot = Plot::new();

        plot.add_trace(uccrv);
        plot.add_trace(crv);
        plot.add_trace(p);
        plot.add_trace(z);

        plot.add_trace(comp_img);

        let layout = Layout::new().height(size).width(size);

        plot.set_layout(layout);

        plot.show();

    }
}

impl DrawBary for Barycentric<f64>
{
    fn draw(&self) {

    let min = self.nodes.iter().cloned().reduce(f64::min).unwrap();
    let max = self.nodes.iter().cloned().reduce(f64::max).unwrap();

    let xx: Vec<f64> = lin_space(min..=max, 5001).collect();

    let mut ptsmain: Vec<f64> = Vec::new();

    for i in xx.clone() {
    let val = self.evaluate(i);
    ptsmain.push(val);
    }

    let main = Scatter::new(xx.clone(), ptsmain.clone())
        .mode(Mode::Lines).fill_color(Rgb::new(0, 0, 255)).name("Main");

    let mut plot = Plot::new();

    let layout = Layout::new().height(1000).width(1000).auto_size(false);
    plot.set_layout(layout);

    plot.add_trace(main);
    plot.show();

    }
}

impl DrawBary for Barycentric<Complex64> {
    fn draw(&self) {

    let xx: Vec<f64> = lin_space(-1.0..=1.0, 5000).collect();

    let mut ptsmain: Vec<Complex64> = Vec::new();
    let mut ptsre: Vec<f64> = Vec::new();
    let mut ptsim: Vec<f64> = Vec::new();
    let mut ptsabs: Vec<f64> = Vec::new();

    for i in &xx {
    let pts = self.evaluate(Complex64::new(*i, 0.0)).to_polar();
    ptsre.push(pts.0);
    ptsim.push(pts.1);
    ptsabs.push(self.evaluate(Complex64::new(*i, 0.0)).abs());
    ptsmain.push(self.evaluate(Complex64::new(*i, 0.0)));
    }

    let x: Vec<f64> = ptsmain.iter().map(|f|f.re()).collect();
    let y: Vec<f64> = ptsmain.iter().map(|f|f.im()).collect();

    let main = Scatter::new(x.clone(), y.clone())
        .mode(Mode::Lines).fill_color(Rgb::new(0, 0, 255)).name("Re");

    let main2 = Scatter::new(xx.clone(), y)
        .mode(Mode::Lines).fill_color(Rgb::new(0, 0, 255)).name("Im");

    let main3 = Scatter::new(xx, ptsabs)
        .mode(Mode::Lines).fill_color(Rgb::new(0, 0, 255)).name("Abs");

    let mut plot = Plot::new();

    let layout = Layout::new().height(1000).width(1000).auto_size(false);
    plot.set_layout(layout);

    plot.add_trace(main);
    plot.add_trace(main2);
    plot.add_trace(main3);

    plot.show();
    }
}

pub trait DrawFn {
    fn draw(self, min: f64, max: f64);
}

impl<T> DrawFn for T
where T: Fn(f64) -> f64
{
    fn draw(self, min: f64, max: f64) {

    let x: Vec<f64> = lin_space(min..=max, 5000).collect();
    let mut y: Vec<f64> = Vec::new();

    for i in &x {
        y.push(self(*i));
    }

    let bmain = Scatter::new(x.clone(), y)
        .mode(Mode::Lines).fill_color(Rgb::new(0, 255, 0));

    let mut plot = Plot::new();

    let layout = Layout::new().height(1000).width(1000).auto_size(false);

    plot.set_layout(layout);

    plot.add_trace(bmain);

    plot.show();
    }
}
 
