#[allow(unused)]
fn hsv_to_rgb_64(c: (f64, f64, f64)) -> Rgb {
    let p = (
        ((c.0 + 1.0).fract() * 6.0 - 3.0).abs(),
        ((c.0 + 2.0 / 3.0).fract() * 6.0 - 3.0).abs(),
        ((c.0 + 1.0 / 3.0).fract() * 6.0 - 3.0).abs(),
    );
    let r = c.2 * mix_64(1.0, (p.0 - 1.0).clamp(0.0, 1.0), c.1);
    let g = c.2 * mix_64(1.0, (p.1 - 1.0).clamp(0.0, 1.0), c.1);
    let b = c.2 * mix_64(1.0, (p.2 - 1.0).clamp(0.0, 1.0), c.1);

    Rgb::new(r as u8, g as u8, b as u8)
}

pub fn mix_64(a: f64, b: f64, t: f64) -> f64 {
    a * (1.0 - t) + b * t
}

#[allow(unused)]
fn rbg(t: f64) -> Rgb {
    let a = (0.5, 0.5, 0.5);
    let b = (0.5, 0.5, 0.5);
    let c = (1.0, 1.0, 1.0);
    let d = (0.0, 0.1, 0.2);
    let r = (b.0 * (std::f64::consts::TAU * (c.0 * t + d.0)).cos() + a.0) * 255.0;
    let g = (b.1 * (std::f64::consts::TAU * (c.1 * t + d.1)).cos() + a.1) * 255.0;
    let b = (b.2 * (std::f64::consts::TAU * (c.2 * t + d.2)).cos() + a.2) * 255.0;

    Rgb::new(r as u8, g as u8, b as u8)
}

#[allow(unused)]
fn hsv_to_rgb(hue: f64) -> Rgb {
    let hue = hue % 360.0;

    let chroma = 1.0;
    let value = 1.0;

    let h_prime = hue / 360.0;
    let x = chroma * (1.0 - ((h_prime % 2.0) - 2.0).abs());

    let (r1, g1, b1) = if h_prime < 1.0 {
        (chroma, x, 0.0)
    } else if h_prime < 2.0 {
        (x, chroma, 0.0)
    } else if h_prime < 3.0 {
        (0.0, chroma, x)
    } else if h_prime < 4.0 {
        (0.0, x, chroma)
    } else if h_prime < 5.0 {
        (x, 0.0, chroma)
    } else {
        (chroma, 0.0, x)
    };

    let m = value - chroma;
    let r = (r1 + m) * 255.0;
    let g = (g1 + m) * 255.0;
    let b = (b1 + m) * 255.0;

    Rgb::new(r as u8, g as u8, b as u8)
}

#[allow(unused)]
fn get_mygbm_colormap_color(t: f64) -> Rgb {

    let key_colors = [
        [255.0, 0.0, 255.0], 
        [255.0, 255.0, 0.0], 
        [0.0, 255.0, 0.0],   
        [0.0, 0.0, 255.0],   
        [255.0, 0.0, 255.0], 
    ];
    let num_segments = (key_colors.len() - 1) as f64;
    let scaled_t = t * num_segments;
    let segment_index = scaled_t.floor() as usize;
    let segment_t = scaled_t.fract();

    let start_color = key_colors[segment_index];
    let end_color = key_colors[segment_index + 1];

    let r = start_color[0] + (end_color[0] - start_color[0]) * segment_t;
    let g = start_color[1] + (end_color[1] - start_color[1]) * segment_t;
    let b = start_color[2] + (end_color[2] - start_color[2]) * segment_t;

    Rgb::new(r as u8, g as u8, b as u8)
}

fn phase_coloring_scheme(base: f64) -> impl Fn(Complex<f64>) -> Rgb {
    assert!(base > 0.0 && base != 1.0, "Logarithm base must be positive and not equal to 1.");
    let log_base = base.ln();

    move |w: Complex<f64>| -> Rgb {
        if w.is_nan() {
            return Rgb::new(0, 0, 0);
        }

        let phase = w.arg();
        let hue = (phase.to_degrees() + 180.0) % 360.0;

        let magnitude = w.norm();
        let s1 = if magnitude > 0.0 { (magnitude.ln() / log_base).fract() } else { 0.0 };
        let s1 = if s1 < 0.0 { s1 + 1.0 } else { s1 };

        let brightness_mod = 0.6 + 0.4 * s1;

        let saturation = 1.0;
        let base_lightness = 0.5;
        
        let final_lightness = base_lightness * brightness_mod;

        let hsl = HSL { h: hue, s: saturation, l: final_lightness };
        let (r, g, b) = hsl.to_rgb();
        Rgb::new(r, g, b)
    }
}